def _streamThreadExtract(names, test, lock):
	for name in names:
		if tools.Tools.isDictionary(name): Stream.load(validate = False, lock = lock, metaMedia = test['media'], metaTitle = test['title'], metaYear = test['year'], cache = False, **name)
		else: Stream.load(validate = False, lock = lock, fileName = name, metaMedia = test['media'], metaTitle = test['title'], metaYear = test['year'], cache = False)

def _streamThreadValid(items, test, lock):
	for item in items:
		item.valid(lock = lock)

def _streamThreadAll(names, test, lock):
	for name in names:
		if tools.Tools.isDictionary(name): Stream.load(validate = True, lock = lock, metaMedia = test['media'], metaTitle = test['title'], metaYear = test['year'], metaSeason = test['show']['season'] if 'show' in test else None, metaEpisode = test['show']['episode'] if 'show' in test else None, cache = False, **name)
		else: Stream.load(validate = True, lock = lock, fileName = name, metaMedia = test['media'], metaTitle = test['title'], metaYear = test['year'], metaSeason = test['show']['season'] if 'show' in test else None, metaEpisode = test['show']['episode'] if 'show' in test else None, cache = False)

